import React from 'react';
import Navbar from './components/navbar';
import News from './components/News';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Navbar />
        <Routes>
          <Route path="/enterntainment"/><News catagory="enterntainment" country="in" pageSize={10}/>
          <Route path="/sports"/><News catagory="aports" country="in" pageSize={10}/>
          <Route path="/health"/><News catagory="health" country="in" pageSize={10}/>
          <Route path="/business"/><News catagory="business" country="in" pageSize={10}/>
          <Route path="/general"/><News catagory="general" country="in" pageSize={10}/>
          <Route path="/science"/><News catagory="science" country="in" pageSize={10}/>
          <Route path="/Technology"/><News catagory="technology" country="in" pageSize={10}/>
        </Routes>
      </div>
    </BrowserRouter>
  );
};

export default App;
